tables.table_schema:
CREATE TABLE quantum_algorithm_execution (
    execution_id SERIAL PRIMARY KEY,
    algorithm_name TEXT NOT NULL,
    execution_time TIMESTAMP NOT NULL,
    result JSONB
);

CREATE TABLE Quantum_Algorithms (
    algorithm_id INT PRIMARY KEY,
    algorithm_name TEXT NOT NULL,
    execution_time FLOAT,
    execution_date DATE
);

CREATE TABLE Execution_Results (
    result_id INT PRIMARY KEY,
    algorithm_id INT,
    result TEXT,
    execution_status BOOLEAN
);

CREATE TABLE Algorithm_Research_Users (
    user_id INT PRIMARY KEY,
    user_name TEXT NOT NULL,
    institution TEXT,
    email TEXT
);

CREATE TABLE quantum_algorithms (
    id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    execution_date TIMESTAMP,
    execution_status VARCHAR(50)
);

CREATE TABLE algorithm_results (
    result_id INT PRIMARY KEY,
    algorithm_id INT,
    execution_time DECIMAL(10, 2),
    result_data TEXT
);

CREATE TABLE algorithm_parameters (
    param_id INT PRIMARY KEY,
    algorithm_id INT,
    parameter_name VARCHAR(100),
    parameter_value VARCHAR(255)
);

CREATE TABLE algorithm_logs (
    log_id INT PRIMARY KEY,
    algorithm_id INT,
    log_timestamp TIMESTAMP,
    log_message TEXT
);
